@Component({
  selector: 'app-if-switch-for',
  templateUrl: './if-switch-for.component.html',
  styleUrls: ['./if-switch-for.component.css']
})
export class IfSwitchForComponent {

indicator = true;

OnChange(){
  this.indicator = false;
}


}
